import React from "react";
import { Drawer, Form } from "antd";
const ReservationDrawer = ({ visible }) => {
  return (
    <Drawer
      title="Reserv place"
      visible={visible}
      closable={false}
      placement="bottom"
    >
      <Form hideRequiredMark>
        <Form.item></Form.item>
      </Form>
    </Drawer>
  );
};

export default ReservationDrawer;
